import React from 'react'
import BoardRow from './BoardRow'

const Board = (props) => {
    const { handleChange, handleFocus, cellValues, cellsBackgroundColors } = props
    const nineArray = [1, 2, 3, 4, 5, 6, 7, 8, 9]
    return (
        <div className="container">
            <div className="card">
                <table>
                    <tbody>
                        {nineArray.map((element) => {
                            return (
                                <BoardRow 
                                key={element}
                                handleFocus={handleFocus}
                                cellValues={cellValues}
                                cellsBackgroundColors={cellsBackgroundColors}
                                id={element.toString()}
                                />
                            )
                        })}

                    </tbody>
                </table>
            </div>
        </div>
    )
}

export default Board
